import React from 'react';
import OrderTable from '../components/OrderTable';

function OrderPage() {
    return (
        <div>
            <h2>
                Order your groceries!
            </h2>
            <p>
                Please select what quantity of each item you would like to buy!
            </p>
            <OrderTable/>
        </div>
    );
}

export default OrderPage;
